svg.script:
     var lastCircle;
     function init( evt ) {
        parent.updateSVG = svgClicked;
        parent.svgHide = svgHide;
        parent.svgShow = svgShow;
     }
     function svgClicked(circleId) {
         obj = svgDocument.getElementById('circle'+circleId);
         if (lastCircle == null) {
            obj.setAttribute("fill", "#a00000");
         } else {
            lastCircle.setAttribute("fill", "white");
            obj.setAttribute("fill", "#a00000");
         }
         lastCircle = obj; 
         testit(circleId); 
     }
     function svgShow(circleId) {
         obj = svgDocument.getElementById('circle'+circleId);
         obj.setAttribute("visibility", "visible");
         svgClicked(circleId);
     }
     function svgHide(circleId) {
         obj = svgDocument.getElementById('circle'+circleId);
         obj.setAttribute("visibility", "hidden");
     }
